import { pool } from "../db.js";
import PDFDocument from "pdfkit";

export const obtenerCertificadosCliente = async (req, res) => {
    const { idCliente } = req.params
    try {

        const [rows] = await pool.query("select c.*, concat(u.nombre, ' ', u.primerApellido, ' ', u.segundoApellido) as nombreCliente, cu.nombre as nombreCurso, cu.duracion as duracionCurso, cc.fechaFinalizacionCurso as fechaFinalizadoCurso from certificacion as c inner join usuario as u on c.idCliente = u.idUsuario inner join curso as cu on c.idCurso = cu.idCurso inner join cliente_curso as cc on cu.idCurso = cc.idCurso where c.idCliente = ?", [idCliente])

        res.send(rows)

    } catch (error) {
        res.status(500).json({ "mensaje": "Algo salio mal" });
    }
}

export const registrarCertificado = async (req, res) => {
    const { idCurso, idCliente } = req.body

    try {
        const [rows] = await pool.query("INSERT INTO certificacion (idCurso, idCliente) value (?,?)", [idCurso, idCliente])

        if (rows.insertId == 0) return res.sendStatus(404).json({ "mensaje": "No se pudo registrar la calificacion" })

        res.send({
            idCertificado: rows.insertId,
            idCurso,
            idCliente
        })

    } catch (error) {
        res.status(500).json({ "mensaje": "Algo salio mal" });
    }
}

export const generarCertificado = async (req, res) => {
    const { idCertificado } = req.params
    try {
        const [rows] = await pool.query("select c.*, concat(u.nombre, ' ', u.primerApellido, ' ', u.segundoApellido) as nombreCliente, cu.nombre as nombreCurso, cu.duracion as duracionCurso, cc.fechaFinalizacionCurso as fechaFinalizadoCurso from certificacion as c inner join usuario as u on c.idCliente = u.idUsuario inner join curso as cu on c.idCurso = cu.idCurso inner join cliente_curso as cc on cu.idCurso = cc.idCurso where c.idCertificacion = ?", [idCertificado])

        if(rows.length == 0) return res.sendStatus(404).json({"mensaje": "No se encontro el certificado"})

        let cert = rows[0];

        let doc = new PDFDocument({ bufferPages: true });
        //let stream = doc.pipe(BlobStream());

        let buffers = [];
        doc.on('data', buffers.push.bind(buffers));
        doc.on('end', () => {

            let pdfData = Buffer.concat(buffers);
            res.writeHead(200, {
                'Content-Length': Buffer.byteLength(pdfData),
                'Content-Type': 'application/pdf',
                'Content-disposition': `attachment;filename=${cert.nombreCliente}_${cert.nombreCurso}.pdf`,
            })
                .end(pdfData);

        });

        doc.rect(0, 0, 800, 15).fillAndStroke("orange", "orange");

        doc.image('data:image/png;base64,', {
            fit: [100, 100],
        });

        doc.fillColor("black").fontSize(25).font("Helvetica-Bold").text('CERTIFICADO', 100, 80, { align: "center" });

        doc.moveDown(2).fontSize(16).font("Helvetica").text("Novatec Consultores Mxico agradece a:", { align: "center" })

        doc.moveDown(2).fontSize(20).font("Helvetica-Bold").text(`${cert.nombreCliente}`, { align: "center" })

        doc.moveDown(2).fontSize(16).font("Helvetica").text(`Por haber culminado con exito el curso ${cert.nombreCurso} en un periodo de ${cert.duracionCurso} horas. Siendo de esta manera que dio finalizado el curso el dia ${cert.fechaFinalizadoCurso}.`, { align: "justify" })


        doc.moveDown(4).image("data:image/png;base64,",
            250, 450, { cover: [150, 150], align: 'center' }
        )

        doc.rect(0, 740, 800, 55).fillAndStroke("#274a93", "#274a93");


        doc.end();

    } catch (error) {
        res.status(500).json({"mensaje": "Algo salio mal"});
    }
}